import React, { useState } from 'react';

const App = () => {
  const [user, setUser] = useState('')

  const auth = () => {
    let name = 'test_super'
    let pasw = 'Nf<U4f<rDbtDxAPn'
    fetch(`http://emphasoft-test-assignment.herokuapp.com/swagger/?format=openapi/api-token-auth/${name}&${pasw}`)
  }

  return (
    <div>
      <h1>{user}</h1>
      <input placeholder='name' type='text' onChange={e => setUser(e.target.value)} />

      <button onClick={() => auth()}>Auth</button>
    </div>
  );
}

export default App;
